query:
(

    $diff := $.diffMin[ruleId = "rename-path"];

    {
        "version": "Meraki API v0 to v1",
        "totalPathRenames": $count($diff),
        "diff": $diff^(path).{
            "oldPath": path,
            "newPath": newPath,
            "oldOperations": operations,
            "newOperations": newOperations
        }
    }
)
